function App() {
  return (
    <div className="Wrapper">
      <header>
        <div class="headerLeft">
        <svg />
        <div class="headerRight">
          <h3>Twelve Store</h3>
          <p>Путеводитель в мир Poizon!</p>
        </div>
        </div>
        <ul>
          <li><svg /><span>1205 руб.</span></li>
          <li><svg /> </li>
        </ul>
      </header>
    </div>
  );
}

export default App;
